// Base64 encoded image string
const base64Image = 'data:image/jpeg;base64,';
// Get the canvas element from the DOM
const canvas = document.getElementById('main');

const ctx = canvas.getContext('2d');

// Create an Image object
const img = new Image();

// Set the src attribute to the base64 encoded image
img.src = base64Image;

// When the image is loaded, execute this code
img.onload = function() {
  // Calculate scale to fill the canvas without distortion
  const scale = Math.max(canvas.width / img.width, canvas.height / img.height);

  // Calculate scaled dimensions
  const scaledWidth = img.width * scale;
  const scaledHeight = img.height * scale;

  // Calculate position to center the scaled image on the canvas
  const x = (canvas.width - scaledWidth) / 2;
  const y = (canvas.height - scaledHeight) / 2;

  // Clear canvas
  ctx.clearRect(0, 0, canvas.width, canvas.height);

  // Draw the scaled image onto the canvas
  ctx.drawImage(img, x, y, scaledWidth, scaledHeight);

  // Calculate average color of the image pixels within the scaled area
  const imageData = ctx.getImageData(x, y, scaledWidth, scaledHeight);
  const pixels = imageData.data;
  let totalRed = 0, totalGreen = 0, totalBlue = 0;

  for (let i = 0; i < pixels.length; i += 4) {
    totalRed += pixels[i];
    totalGreen += pixels[i + 1];
    totalBlue += pixels[i + 2];
  }

  const pixelCount = pixels.length / 4;
  const avgRed = Math.round(totalRed / pixelCount);
  const avgGreen = Math.round(totalGreen / pixelCount);
  const avgBlue = Math.round(totalBlue / pixelCount);

  // Convert average RGB values to CSS color format
  const avgColor = `rgb(${avgRed}, ${avgGreen}, ${avgBlue})`;

  // Draw an outline with rounded corners using paths
  ctx.beginPath();
  ctx.moveTo(x + 10, y); // Move to top left corner
  ctx.lineTo(x + scaledWidth - 10, y); // Draw top line
  ctx.arcTo(x + scaledWidth, y, x + scaledWidth, y + 10, 10); // Draw top right corner
  ctx.lineTo(x + scaledWidth, y + scaledHeight - 10); // Draw right line
  ctx.arcTo(x + scaledWidth, y + scaledHeight, x + scaledWidth - 10, y + scaledHeight, 10); // Draw bottom right corner
  ctx.lineTo(x + 10, y + scaledHeight); // Draw bottom line
  ctx.arcTo(x, y + scaledHeight, x, y + scaledHeight - 10, 10); // Draw bottom left corner
  ctx.lineTo(x, y + 10); // Draw left line
  ctx.arcTo(x, y, x + 10, y, 10); // Draw top left corner
  ctx.closePath(); // Close path

  ctx.lineWidth = 10;
  ctx.strokeStyle = avgColor;
  ctx.stroke();
};
